import React from 'react';
import { Route } from 'react-router-dom';
import './App.css';

import HomePage from './pages/homepage/homepage.component';

const HatPage = ()=> (
  <div>
    <h1>HATPAGE</h1>
  </div>
)

function App() {
  return (
  <div>
<Route path='/' component={HomePage} />
<Route path='/hat' component={HatPage} />

  </div>
  )
}

export default App;
